import { StyleSheet, Text, View } from "react-native";
import LoginForm from "./screens/LoginScreen";

export default function App() {
  return (
    <View style={styles.container}>
      <Text>Hello</Text>
      <LoginForm />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
